![medium](https://www.gstatic.com/codereviewagent/medium-priority.svg)

Using `any` for the `task` parameter in `handleCreateTask` (and `handleUpdateTask` on line 395) sacrifices type safety. It would be better to define a specific type for the API payload, for example `TaskApiPayload`, which reflects the structure created by `mapFormValuesToApiPayload`. This would improve maintainability and catch potential errors during development.

Example type definition:
```typescript
interface TaskApiPayload {
  title: string;
  description: string;
  due_date?: string;
  start_date?: string;
  priority?: number;
  project_id?: number;
  completed: boolean;
  subtasks?: { id: number; title: string; completed: boolean; }[];
  // ... other fields
}
```
Then you can use `handleCreateTask = async (task: TaskApiPayload) => { ... }`.

