![medium](https://www.gstatic.com/codereviewagent/medium-priority.svg)

The logic to determine `project_id` is quite nested and can be hard to follow. It could be refactored for better readability and maintainability. Using an immediately-invoked function expression (IIFE) can help simplify this logic while keeping it as an expression.

```typescript
    const project_id = (() => {
      const pid = values.project_id ?? values.projectId;
      if (typeof pid === 'string') {
        return pid ? Number(pid) : undefined;
      }
      if (typeof pid === 'number') {
        return pid;
      }
      return undefined;
    })();
```

